import React from 'react'
import "./agents.css"

function AgentsCard({agent}) {
  return (
    <div className = "card-items">
        <div className="card">
            <img
                src = {agent.image}
                alt = {agent.name}
                classNmae = "card-image"
            />
            <div className="card_content">
                <div className="card_title">{agent.name}</div>
                <div className="card_contact">                   
                   {agent.mobile}

                   {agent.email}
                   {agent.office}
                </div>
                <div className="card_about">{agent.about}</div>
            </div>
        </div>
    </div>
  )
}

export default AgentsCard
